def kmer(text,k,i):
  return text[i:i+k]

def mf(text,k):
  c=0
  kmers=list()
  most=set()
  for i in range(0,len(text)-k+1):
    if (kmer(text,k,i) not in kmers):
      kmers.append(kmer(text,k,i))
  for km in kmers:
    d=0
    for i in range(0,len(text)-k+1):
      if (kmer(text,k,i)==km):
        d+=1
    if (d>c):
      most.clear()
      most.add(km)
      c=d
    if (d==c):
      most.add(km)
  return most

mf("",12)